import { useState, useEffect } from "react";

function Starlink() {
    const [starlinks, setStarlinks]=useState([])
    useEffect(() => {
        fetch("https://api.spacexdata.com/v4/starlink")
        .then((response)=> response.json())
        .then((data) => setStarlinks(data))
    }, [])
    return (
      <div className="Block">
        <h2>Starlinks</h2>
      </div>
    );
  }

  export default Starlink;
